import React, { Component } from 'react';
import { Link } from 'react-router-dom';

const navbar = {
    backgroundColor: "#282c34",
    height: "45px",
    padding: "10px 50px 10px 50px",
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    color: "white",
}

const leftPart = {
    display: "flex",
    flexDirection: "column",
    alignItems: "left",
    justifyContent: "space-evenly",
}

const a = {
    color: "#61dafb",
    margin: "8px",
    textDecoration: "none",
}



export default class Header extends Component {
    render() {
        return (
            <nav style={navbar}>
                <div style={leftPart}>
                    <b>/Nikolaj Johannes Skole Jensen</b>
                    <small>Web/App-developer and biologist</small>
                </div>
                <Link style={a} to="/">Front</Link>
                <div>

                    <Link style={a} to="/projects">Projects</Link>
                    <Link style={a} to="/experience">Experience</Link>
                    <Link style={a} to="/articles">Articles</Link>
                    <Link style={a} to="/contact">Contact</Link>
                </div>
            </nav>
        )
    }
}
